import React, {Component} from 'react'
import TaskAssignmentListHead from './TaskAssignmentListHead'
class TaskAssignmentList extends Component{


	render(){
		console.log(['TaskAssignmentList'], this.props.campaign);



		let tasks =  this.props.questionnaire? this.state.questionnaire.map(qnr =>{
			let question = (<QuestionnaireComponent edit = {this.editHandler} key = {qnr.id} btnID = {qnr.id} question={qnr.question}/> )
		    return question;
		  }) : null;

		const comp = this.props.campaign? (<div>
			<div className='col-11'>
				<TaskAssignmentListHead />
			</div>
		</div>): null;
		return (
			<div>
				{comp}
			</div>
		) ;
	}
}

export default TaskAssignmentList;
